import axios from "axios";
import React, { useEffect, useState } from "react";
import './Weather.css'

//https://danepubliczne.imgw.pl/api/data/synop/

function Weather() {
    // react hook on stage
    const [danePogodowe, setDanePogodowe] = useState([]);

    useEffect(() => {
        const getData = () => {
            axios
                .get("https://danepubliczne.imgw.pl/api/data/synop/")
                .then((dane) => {
                    console.log(dane.data); // odpowiednik print
                    setDanePogodowe(dane.data);
                })
                .catch((error) => {
                    console.log(error);
                    return null;
                });
        };
        getData();
    }, []);

    return (
        <div>
            <div>Dane pogodowe</div>
            <div>
                {
                    // danePogodowe.map(({id_stacja, stacja }) => {return <div key={id_stacji}})
                    danePogodowe.map(({ stacja, temperatura, cisnienie }) => {
                        // map zwraca pojedynczy wiersz z tabeli
                        return (
                            <div>
                                <div className="weather_title">Dane ze stacji {stacja} </div>
                                <div className="weather_params">
                                    Temperatura {temperatura} Â°C,
                                    <br /> Cisnienie {cisnienie} hPa{" "}
                                </div>
                            </div>
                        );
                    })
                }
            </div>
        </div>
    );
}

export default Weather;
